import React from 'react';
import './App.css';

import InicioPagina from './paginas/InicioPagina';
import ContactoPagina from './paginas/ContactoPagina';
import ArtistasPagina from './paginas/ArtistasPagina';

import { Routes, Route, BrowserRouter as Router } from "react-router-dom";

import Menu from './Menu';
import Artista from './componentes/Artista';

function App() {
  return (
    <>
      <Menu />
      <div className="container pt-5 mt-5">

    <Router>
      <Routes>
        <Route path="/" element={<InicioPagina />} />
        <Route path="/contacto" element={<ContactoPagina />} />
        <Route path="/artistas" element={<ArtistasPagina />} />
      </Routes>
    </Router>

      <h2> Inicio </h2>
      <p>Bienvenido a mi página de artistas favoritos :D aqui almacenare mis artistas favoritos para no olvidarlos.</p>

      <Artista 
        nombre="Dire Straits" 
        img="/img/direstraits.jpg"
        descripcion="Dire Straits fue una banda de rock britanico formada en Londres en 1977 por Mark Knopfler y su hermano David Knopfler, estando activos hasta el año 1995."/>

      <Artista 
        nombre="The Who" 
        img="/img/thewho.jpg"
        descripcion="The Who es una banda britanica de rock considerada un icono de la musica del siglo XX."/>

      <Artista 
        nombre="Jack Johnson" 
        img="/img/jackjohnson.jpg"
        descripcion="Jack Johnson es un cantautor de folk rock, surfista, poeta y cineasta hawaiano."/>
    </div>
    </>
  );
}

export default App;
